import React from 'react';

const Logo = () => {
    return <>
        <a className="logo header__logo" href="/" aria-label="На главную">
            <img src="../img/logo1.png" width="30" height="27" alt="Logo AK programming"></img>
        </a>
    </>
}

export default Logo;
